import InviteTrainee from '../pages/InviteTrainee';
import React, { useEffect, useState } from 'react';
import TrainerHeader from './TrainerHeader';
import './Dashboard.css';
// เพิ่มสไตล์ธีมม่วงแบบหน้า trainee
const themePurple = {
  background: 'linear-gradient(135deg, #f8fafc 0%, #e2e8f0 100%)',
  minHeight: '100vh',
  fontFamily: 'Inter, sans-serif',
};

const TrainerDashboard = () => {
  const [videos, setVideos] = useState([]);
  const [summary, setSummary] = useState(null);
  const [traineeReport, setTraineeReport] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState('');
  const [profile, setProfile] = useState({ name: '', email: '', picture: '' });

  useEffect(() => {
    const token = localStorage.getItem('token');
    setIsLoading(true);
    // Fetch all trainers (simulate as trainer's own data for now)
    fetch('http://localhost:8000/trainers', {
      headers: { Authorization: `Bearer ${token}` }
    })
      .then(res => res.json())
      .then(trainers => {
        // Assume the first trainer is the logged-in trainer (for demo)
        const trainer = Array.isArray(trainers) && trainers.length > 0 ? trainers[0] : null;
        if (trainer) {
          setProfile({
            name: trainer.name,
            email: trainer.email,
            picture: '/user (1).png'
          });
          // Fetch trainer profile for more details
          fetch(`http://localhost:8000/trainers/${trainer.id}`, {
            headers: { Authorization: `Bearer ${token}` }
          })
            .then(res => res.json())
            .then(profileData => {
              // Simulate summary and report from profileData
              setSummary({
                most_popular_title: 'N/A',
                most_popular_count: 0,
                total_usage: 0
              });
              setTraineeReport([]); // No trainee report in backend yet
              setVideos([]); // No videos endpoint in backend yet
            })
            .catch(() => setError('เกิดข้อผิดพลาดในการโหลดข้อมูลโปรไฟล์เทรนเนอร์'))
            .finally(() => setIsLoading(false));
        } else {
          setError('ไม่พบข้อมูลเทรนเนอร์');
          setIsLoading(false);
        }
      })
      .catch(() => {
        setError('เกิดข้อผิดพลาดในการโหลดข้อมูลเทรนเนอร์');
        setIsLoading(false);
      });
  }, []);

  if (isLoading) return <div className="dashboard-loading"><div className="loading-spinner"></div><p>กำลังโหลดข้อมูล...</p></div>;
  if (error) return <div className="error-message">{error}</div>;

  return (
    <div className="dashboard trainer-dashboard-bg" style={themePurple}>
      {/* Header (TrainerHeader ไม่มี pts) */}
      <TrainerHeader
        user={{
          name: profile.name,
          picture: profile.picture || '/user (1).png',
        }}
        date={"1 June 2025"}
      />


      {/* Layout: Memberlist + Videolist */}
      <div style={{display:'flex',gap:32,alignItems:'flex-start',padding:'0 0 2rem 0'}}>
        {/* Memberlist */}
        <aside style={{background:'#fff',borderRadius:20,padding:'2rem 1.5rem',boxShadow:'0 2px 16px rgba(0,0,0,0.06)',minWidth:300,maxWidth:340,flex:'0 0 320px',display:'flex',flexDirection:'column',gap:16}}>
          <div style={{fontWeight:700,fontSize:'1.1rem',marginBottom:8}}>Memberlist (12)</div>
          <div style={{display:'flex',gap:8,marginBottom:16}}>
            <input type="email" placeholder="Type an email to Invite" style={{flex:1,padding:'0.5rem 1rem',borderRadius:16,border:'1px solid #e5e7eb',fontSize:'1rem'}} />
            <button style={{background:'linear-gradient(90deg,#ff4d8b 0%, #a855f7 100%)',color:'#fff',fontWeight:700,border:'none',borderRadius:16,padding:'0.5rem 1.2rem',fontSize:'1rem',display:'flex',alignItems:'center',gap:6,cursor:'pointer'}}>
              <span style={{fontSize:'1.3rem',marginRight:2}}>+</span> Invite
            </button>
          </div>
          {/* Member avatars list (mockup) */}
          <div style={{flex:1,overflowY:'auto',maxHeight:420}}>
            {/* ตัวอย่างสมาชิก */}
            {[...Array(8)].map((_,i)=>(
              <div key={i} style={{display:'flex',alignItems:'center',gap:12,marginBottom:12}}>
                <img src={process.env.PUBLIC_URL+`/user (${(i%4)+1}).png`} alt="avatar" style={{width:36,height:36,borderRadius:'50%',objectFit:'cover',border:'2px solid #e5e7eb'}} />
                <div style={{fontWeight:600}}>Plume FitAddict</div>
                <span style={{width:10,height:10,borderRadius:'50%',background:'#22c55e',display:'inline-block',marginLeft:'auto',marginRight:8}}></span>
                <span style={{fontSize:22,color:'#64748b',cursor:'pointer'}}>⋮</span>
              </div>
            ))}
          </div>
        </aside>
        {/* Videolist */}
        <main style={{flex:1}}>
          <div style={{display:'flex',justifyContent:'space-between',alignItems:'center',marginBottom:16}}>
            <div style={{fontWeight:700,fontSize:'1.1rem'}}>Videolist (4)</div>
            <button style={{background:'linear-gradient(90deg,#ff4d8b 0%, #a855f7 100%)',color:'#fff',fontWeight:700,border:'none',borderRadius:16,padding:'0.5rem 1.5rem',fontSize:'1rem',display:'flex',alignItems:'center',gap:8,cursor:'pointer'}}>
              <span style={{fontSize:'1.2rem',fontWeight:900}}>⬆</span> Upload
            </button>
          </div>
          {/* Video cards mockup */}
          <div style={{display:'grid',gridTemplateColumns:'repeat(auto-fit,minmax(240px,1fr))',gap:20}}>
            {[...Array(4)].map((_,i)=>(
              <div key={i} style={{background:'#fff',borderRadius:16,boxShadow:'0 2px 12px rgba(0,0,0,0.06)',padding:'1rem',display:'flex',flexDirection:'column',gap:8}}>
                <img src={process.env.PUBLIC_URL+`/sample${(i%2)+1}.jpg`} alt="video" style={{width:'100%',height:120,objectFit:'cover',borderRadius:12}} />
                <div style={{fontWeight:700,fontSize:'1.1rem'}}>Pushups</div>
                <div style={{display:'flex',alignItems:'center',gap:12,fontSize:'0.98rem',color:'#a855f7'}}>
                  <span>🕒 30.20 น.</span>
                  <span>🔥 20 Kcal</span>
                </div>
                <div style={{fontSize:'0.98rem',color:'#64748b'}}>Score Avg. <b style={{color:'#222'}}>95%</b></div>
                <div style={{display:'flex',gap:8}}>
                  <span style={{background:'#22c55e',color:'#fff',fontWeight:600,borderRadius:8,padding:'0.2rem 0.8rem',fontSize:'0.95rem'}}>Active</span>
                </div>
              </div>
            ))}
          </div>
        </main>
      </div>

      {/* Welcome Section */}
      <section style={{textAlign: 'center', marginBottom: '2.5rem'}}>
        <div style={{background: 'white', borderRadius: 24, boxShadow: '0 2px 12px -2px #a855f722', padding: '2rem 1rem', maxWidth: 900, margin: '0 auto 2rem auto'}}>
          <h2 style={{fontSize: '2rem', fontWeight: 800, color: '#334155', marginBottom: '0.5rem'}}>ยินดีต้อนรับ, preeyanut chitkot!</h2>
          <p style={{color: '#64748b', fontSize: '1.15rem'}}>นี่คือหน้าสำหรับ Trainer คุณสามารถดูสรุปและจัดการระบบของคุณได้ที่นี่</p>
        </div>
      </section>

      {/* Card Section */}
      <section style={{display: 'flex', justifyContent: 'center', gap: '2rem', marginBottom: '2.5rem', flexWrap: 'wrap'}}>
        <div style={{background: 'white', borderRadius: 18, boxShadow: '0 4px 12px -2px #a855f722', minWidth: 280, padding: '1.5rem 1.25rem', flex: '1 1 280px', maxWidth: 350}}>
          <h3 style={{fontWeight: 700, color: '#334155', marginBottom: '0.5rem'}}>วิดีโอของคุณ</h3>
          <p style={{color: '#64748b', marginBottom: '1rem'}}>ดูและจัดการวิดีโอที่คุณอัพโหลด</p>
          <button style={{background: 'linear-gradient(90deg,#fb6600 0%, #ff4d8b 50%, #a855f7 80%, #4f46e5 100%)', color: 'white', fontWeight: 700, border: 'none', borderRadius: 12, padding: '0.5rem 1.25rem', cursor: 'pointer'}}>ดูวิดีโอทั้งหมด</button>
        </div>
        <div style={{background: 'white', borderRadius: 18, boxShadow: '0 4px 12px -2px #a855f722', minWidth: 280, padding: '1.5rem 1.25rem', flex: '1 1 280px', maxWidth: 350}}>
          <h3 style={{fontWeight: 700, color: '#334155', marginBottom: '0.5rem'}}>Invite Trainee</h3>
          <p style={{color: '#64748b', marginBottom: '1rem'}}>เชิญผู้ใช้ใหม่เข้าระบบของคุณ</p>
          <button style={{background: 'linear-gradient(90deg,#fb6600 0%, #ff4d8b 50%, #a855f7 80%, #4f46e5 100%)', color: 'white', fontWeight: 700, border: 'none', borderRadius: 12, padding: '0.5rem 1.25rem', cursor: 'pointer'}}>เชิญผู้ใช้</button>
        </div>
        <div style={{background: 'white', borderRadius: 18, boxShadow: '0 4px 12px -2px #a855f722', minWidth: 280, padding: '1.5rem 1.25rem', flex: '1 1 280px', maxWidth: 350}}>
          <h3 style={{fontWeight: 700, color: '#334155', marginBottom: '0.5rem'}}>Trainee</h3>
          <p style={{color: '#64748b', marginBottom: '1rem'}}>ดูรายงานผู้เข้าอบรมของคุณ</p>
          <button style={{background: 'linear-gradient(90deg,#fb6600 0%, #ff4d8b 50%, #a855f7 80%, #4f46e5 100%)', color: 'white', fontWeight: 700, border: 'none', borderRadius: 12, padding: '0.5rem 1.25rem', cursor: 'pointer'}}>ดูรายงานผู้เข้าอบรม</button>
        </div>
      </section>

      {/* Dashboard analytics and trainee report sections */}
      <>
        {/* Row 1: Video + Analytics */}
        <section className="trainer-section" style={{marginBottom: '2.5rem'}}>
          <div className="dashboard-row" style={{display: 'flex', justifyContent: 'center', alignItems: 'flex-start', gap: '1.5rem', maxWidth: 1100, margin: '0 auto'}}>
            {/* Video card */}
            {videos.length === 0 ? (
              <div className="stat-card" style={{background: 'rgba(255,255,255,0.95)', border: '2px solid #e9d5ff', boxShadow: '0 4px 12px -2px #a855f722', borderRadius: 18, minWidth: 280, maxWidth: 350, flex: '1 1 280px'}}>
                <h2 className="trainer-section-title" style={{color: '#6366f1', fontSize: '1.25rem', marginBottom: '1rem'}}>วิดีโอของคุณ (รายละเอียด)</h2>
                <h3 style={{color: '#7c3aed', fontWeight: 700}}>ตัวอย่างวิดีโอ</h3>
                <div style={{display: 'flex', alignItems: 'center', gap: '0.5rem'}}>
                  <p style={{color: '#64748b', marginBottom: 0}}>ถูกใช้ 12 ครั้ง</p>
                  <span className="popular-badge" style={{background: 'linear-gradient(90deg,#fb6600 0%, #ff4d8b 50%, #a855f7 80%, #4f46e5 100%)', color: 'white', padding: '0.25rem 0.75rem', borderRadius: 12, fontWeight: 600, fontSize: '0.95rem'}}>🔥 Popular</span>
                </div>
              </div>
            ) : (
              videos.map(v => (
                <div className="stat-card video-card" key={v.id} style={{background: 'rgba(255,255,255,0.95)', border: '2px solid #e9d5ff', boxShadow: '0 4px 12px -2px #a855f722', borderRadius: 18, minWidth: 280, maxWidth: 350, flex: '1 1 280px'}}>
                  <h2 className="trainer-section-title" style={{color: '#6366f1', fontSize: '1.25rem', marginBottom: '1rem'}}>วิดีโอของคุณ (รายละเอียด)</h2>
                  <h3 style={{color: '#7c3aed', fontWeight: 700}}>{v.title}</h3>
                  <p style={{color: '#64748b'}}>ถูกใช้ {v.usage_count} ครั้ง</p>
                  {v.is_popular && <span className="popular-badge" style={{background: 'linear-gradient(90deg,#fb6600 0%, #ff4d8b 50%, #a855f7 80%, #4f46e5 100%)', color: 'white', padding: '0.25rem 0.75rem', borderRadius: 12, fontWeight: 600, fontSize: '0.95rem'}}>🔥 Popular</span>}
                </div>
              ))
            )}
            {/* Analytics cards */}
            {summary ? (
              <>
                <div className="stat-card" style={{background: 'rgba(255,255,255,0.95)', border: '2px solid #e9d5ff', boxShadow: '0 4px 12px -2px #a855f722', borderRadius: 18, minWidth: 280, maxWidth: 350, flex: '1 1 280px'}}>
                  <h2 className="trainer-section-title" style={{color: '#6366f1', fontSize: '1.25rem', marginBottom: '1rem'}}>สรุปการใช้งานวิดีโอ</h2>
                  <h3 style={{color: '#7c3aed', fontWeight: 700}}>วิดีโอที่ถูกใช้มากที่สุด</h3>
                  <p style={{color: '#64748b'}}>{summary.most_popular_title} ({summary.most_popular_count} ครั้ง)</p>
                </div>
                <div className="stat-card" style={{background: 'rgba(255,255,255,0.95)', border: '2px solid #e9d5ff', boxShadow: '0 4px 12px -2px #a855f722', borderRadius: 18, minWidth: 280, maxWidth: 350, flex: '1 1 280px'}}>
                  <h2 className="trainer-section-title" style={{color: '#6366f1', fontSize: '1.25rem', marginBottom: '1rem'}}>สรุปการใช้งานวิดีโอ</h2>
                  <h3 style={{color: '#7c3aed', fontWeight: 700}}>จำนวนการใช้งานรวม</h3>
                  <p style={{color: '#64748b'}}>{summary.total_usage} ครั้ง</p>
                </div>
              </>
            ) : (
              <>
                <div className="stat-card" style={{minWidth: 280, maxWidth: 350, flex: '1 1 280px'}}>
                  <h2 className="trainer-section-title" style={{color: '#6366f1', fontSize: '1.25rem', marginBottom: '1rem'}}>สรุปการใช้งานวิดีโอ</h2>
                  <h3 style={{color: '#7c3aed', fontWeight: 700}}>วิดีโอที่ถูกใช้มากที่สุด</h3>
                  <p style={{color: '#64748b'}}>ตัวอย่างวิดีโอ (8 ครั้ง)</p>
                </div>
                <div className="stat-card" style={{minWidth: 280, maxWidth: 350, flex: '1 1 280px'}}>
                  <h2 className="trainer-section-title" style={{color: '#6366f1', fontSize: '1.25rem', marginBottom: '1rem'}}>สรุปการใช้งานวิดีโอ</h2>
                  <h3 style={{color: '#7c3aed', fontWeight: 700}}>จำนวนการใช้งานรวม</h3>
                  <p style={{color: '#64748b'}}>20 ครั้ง</p>
                </div>
              </>
            )}
          </div>
        </section>
        {/* Row 2: Trainee report full width */}
        <section className="trainer-section">
          <div className="trainer-card-list" style={{display: 'flex', justifyContent: 'center', alignItems: 'flex-start', gap: '1.5rem', flexWrap: 'wrap', maxWidth: 1100, margin: '0 auto'}}>
            {traineeReport.length === 0 ? (
              <div className="stat-card" style={{minWidth: 250, flex: '3 1 750px', maxWidth: '100%'}}>
                <h2 className="trainer-section-title" style={{color: '#6366f1', fontSize: '1.25rem', marginBottom: '1rem'}}>รายงานผู้ใช้ (Trainee)</h2>
                <h3 style={{color: '#7c3aed', fontWeight: 700}}>ตัวอย่างผู้ใช้ 1</h3>
                <p style={{color: '#64748b'}}>ออกกำลังกาย 5 ครั้ง</p>
                <p style={{color: '#64748b'}}>Accuracy เฉลี่ย: <span className="accuracy-badge" style={{background: '#ede9fe', color: '#7c3aed', padding: '0.25rem 0.75rem', borderRadius: 12, fontWeight: 600}}>92.5</span></p>
                <button className="action-btn" style={{background: 'linear-gradient(90deg,#fb6600 0%, #ff4d8b 50%, #a855f7 80%, #4f46e5 100%)', color: 'white', fontWeight: 600, border: 'none', borderRadius: 12, padding: '0.5rem 1.25rem', marginTop: '0.5rem', cursor: 'pointer'}}>Subscribe</button>
              </div>
            ) : (
              <div className="stat-card trainee-card" style={{background: 'rgba(255,255,255,0.95)', border: '2px solid #e9d5ff', boxShadow: '0 4px 12px -2px #a855f722', borderRadius: 18, minWidth: 250, flex: '3 1 750px', maxWidth: '100%'}}>
                <h2 className="trainer-section-title" style={{color: '#6366f1', fontSize: '1.25rem', marginBottom: '1rem'}}>รายงานผู้ใช้ (Trainee)</h2>
                {traineeReport.map(t => (
                  <div key={t.id} style={{marginBottom: '1.5rem'}}>
                    <h3 style={{color: '#7c3aed', fontWeight: 700}}>{t.name}</h3>
                    <p style={{color: '#64748b'}}>ออกกำลังกาย {t.workout_count} ครั้ง</p>
                    <p style={{color: '#64748b'}}>Accuracy เฉลี่ย: <span className="accuracy-badge" style={{background: '#ede9fe', color: '#7c3aed', padding: '0.25rem 0.75rem', borderRadius: 12, fontWeight: 600}}>{t.avg_accuracy ? t.avg_accuracy.toFixed(2) : '-'}</span></p>
                    <button className="action-btn" style={{background: 'linear-gradient(90deg,#fb6600 0%, #ff4d8b 50%, #a855f7 80%, #4f46e5 100%)', color: 'white', fontWeight: 600, border: 'none', borderRadius: 12, padding: '0.5rem 1.25rem', marginTop: '0.5rem', cursor: 'pointer'}}>Subscribe</button>
                  </div>
                ))}
              </div>
            )}
          </div>
        </section>
      </>
    </div>
  );
}

export default TrainerDashboard;
